-- | Braille tables auto-generated with a modified version of brltty-ttb.
module Haskore.Interface.Braille.TextTables (
  -- | Available Braille locales.
  Locale(..),
  -- | Translate to Braille, leaving control characters and whitespace unchanged.
  braillify,
  -- | Translate a character to its Unicode Braille representation.
  dots
) where

import Data.Char (isControl, isSpace)
import Data.Ix (inRange)

data Locale = BrailleFormat    -- ^ "brf"
            | Czech            -- ^ "cs"
            | German           -- ^ "de"
            | USEnglish        -- ^ "en_US"
            | BritishEnglish   -- ^ "en_GB"
            | EuropeanFrench   -- ^ "fr_FR"
            | CanadianFrench   -- ^ "fr_CA"
            | Hungary          -- ^ "hu"
            | Italy            -- ^ "it"
            | NetherlandsDutch -- ^ "nl_NL"
            | BelgiumDutch     -- ^ "nl_BE"
            | Spanish          -- ^ "es"
            deriving (Eq, Read, Show)

braillify :: Locale -> String -> String
braillify locale = map f where
  f ch | inRange unicodeBraille $ fromEnum ch = ch
       | isControl ch || isSpace ch           = ch
       | otherwise                            = maybe ch id $ dots locale ch

unicodeBraille = (0x2800, 0x28FF)

